import React, { Component } from "react";
import { Icon, Collapse, Timeline } from "antd";
const { Panel } = Collapse;

class BudgetSideDisplay extends Component {
  constructor(props) {
    super(props);
  }

  getRows = (item) => {
    return (
      <Timeline>
        <Timeline.Item>
          {"Subcategory"} : {item.Subcategory}
